import React from 'react';

const Dashboard = ({ title, posterPath, overview }) => {
    return (
        <div>
            <h2>{title}</h2>
            <img src={`https://image.tmdb.org/t/p/w500${posterPath}`} alt={title} />
            <p>{overview}</p>
        </div>
    );
};

export default Dashboard;
